var CopyPasteJS={init:function(){CopyPasteJS.copys=document.querySelectorAll("[data-copy-origin]");for(var t=0;t<CopyPasteJS.copys.length;t++)CopyPasteJS.copys[t].addEventListener("click",function(){var t=this.getAttribute("data-copy-origin"),e=document.querySelector(t);CopyPasteJS.data=e.value,e.select(),document.execCommand("copy")});CopyPasteJS.pastes=document.querySelectorAll("[data-paste-target]");for(t=0;t<CopyPasteJS.pastes.length;t++)CopyPasteJS.pastes[t].addEventListener("click",function(){var t=this.getAttribute("data-paste-target"),e=document.querySelector(t);e.focus(),document.execCommand("paste")||(e.value=CopyPasteJS.data)});CopyPasteJS.cuts=document.querySelectorAll("[data-cut-origin]");for(t=0;t<CopyPasteJS.cuts.length;t++)CopyPasteJS.cuts[t].addEventListener("click",function(){var t=this.getAttribute("data-cut-origin"),e=document.querySelector(t);CopyPasteJS.data=e.value,e.select(),document.execCommand("cut")})}};CopyPasteJS.init();